        string: "{\n  \"candidates\": [\n    {\n      \"content\": {\n        \"parts\": [\n          {\n            \"text\": \"This document is about **\\\"The Importance of Regular Software Updates.\\\"**\\n\\nThe main topics it covers are:\\n\\n*   **Security Benefits:** How software updates patch vulnerabilities and protect against cyber threats and malicious actors.\\n*   **Performance and Feature Enhancements:** How updates improve software efficiency, fix bugs, and introduce new functionalities.\\n*   **Maintaining Compatibility:** How updates ensure that software works correctly with evolving operating systems, hardware, and other applications, preventing conflicts.\"\n          }\n        ],\n        \"role\": \"model\"\n      },\n      \"finishReason\": \"STOP\",\n      \"index\": 0\n    }\n  ],\n  \"usageMetadata\": {\n    \"promptTokenCount\": 349,\n    \"candidatesTokenCount\": 95,\n    \"totalTokenCount\": 444,\n    \"promptTokensDetails\": [\n      {\n        \"modality\": \"TEXT\",\n        \"tokenCount\": 91\n      },\n      {\n        \"modality\": \"DOCUMENT\",\n        \"tokenCount\": 258\n      }\n    ]\n  },\n  \"modelVersion\": \"gemini-2.5-flash-lite\",\n  \"responseId\": \"RdIgaZLmJt-hxN8PsafFoQQ\"\n}\n"
